import React from "react";

export default function Pokemon({ name, img, types }) {
  console.log("ENTRE A POKEMON");

  const typesMap = types.map((type, index) => {
    type[index];
  });

  return (
    <div>
      <div className="card">
        <h1>{name}</h1>
        <img src={img} alt="" />
        <h2>{typesMap}</h2>
      </div>
    </div>
  );
}
